import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { AuthProvider } from './Authcontext.js';
import './index.css';
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    
      <AuthProvider>
      <div></div>
      <App />
      </AuthProvider>
      
     
    
);
